response:
Given that \(ABCD\) is a trapezoid with \(AD \parallel BC\), \(\overline{AC} \perp \overline{CD}\), and \(\overline{AC}\) bisects \(\angle BAD\), we need to find the area of \(\triangle ACD\) given that the area of \(ABCD\) is 42.

First, let's denote the lengths of the sides and the height of the trapezoid:
- Let \(AD = a\)
- Let \(BC = b\)
- Let \(CD = c\)
- Let the height of the trapezoid (the perpendicular distance between \(AD\) and \(BC\)) be \(h\)

Since \(\overline{AC}\) is perpendicular to \(\overline{CD}\), \(\triangle ACD\) is a right triangle with \(\angle ACD = 90^\circ\).

Given that \(\overline{AC}\) bisects \(\angle BAD\), we can use the Angle Bisector Theorem which states that the ratio of the lengths of the two segments created by the angle bisector on the opposite side is equal to the ratio of the lengths of the other two sides. Therefore, we have:
\[
\frac{BD}{DC} = \frac{AB}{AD}
\]

Since \(AD \parallel BC\), \(\triangle ABD\) and \(\triangle ACD\) are similar triangles by AA similarity (both have a right angle and share \(\angle BAD\)). This implies:
\[
\frac{AB}{AD} = \frac{AB + BC}{AD}
\]

